import './../App.css';
import {Link} from 'react-router-dom'
import {isAuthorized} from "../Tech/UserContext";
import Client from "./Client";
import {Redirect} from "react-router-dom"

function Home() {
    return (
        <div className="App">
            <header className="App-header">
                <h2> Home page </h2>
                <button onClick={<Redirect to='/Login'/>} className='Button-style' >
                    Client
                </button>
            </header>
        </div>
    );
}

